function Main() {
  const dispatch = useDispatch()
  const { me } = useSelector((state) => state.user)

  useEffect(() => {
    if (me !== null) {
      console.log('me', me)
      dispatch(wordGetRequestAction({ userId: me.userId }))
    }
  }, [me])

  return (
    <>
      <WordCard />
      <DirayList />
      <MainLook>글 불러오기</MainLook>
    </>
  )
}

export default Main
